import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import CreateDoctor from './components/sections/CreateDoctor';
import DoctorList from './components/sections/DoctorList';

function App() {
  const [doctors, setDoctors] = useState([]);

  const addDoctor = (doctor) => {
    setDoctors((prevDoctors) => [...prevDoctors, doctor]);
  };

  const deleteDoctor = (index) => {
    const updatedDoctors = doctors.filter((_, i) => i !== index);
    setDoctors(updatedDoctors);
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/doctorlist"
          element={<DoctorList doctors={doctors} deleteDoctor={deleteDoctor} />}
        />
        <Route path="/createdoctor" element={<CreateDoctor addDoctor={addDoctor} />} />
      </Routes>
    </Router>
  );
}

export default App;
